import logo from "./logo.svg";
import "./App.css";
import { Routes, Route } from "react-router";
import Homepage from "./components/Homepage";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Homepage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
